        if (this.reportData.reportSummary.reports.length > 1) {
            this.isLoadSummary = false;
        }
        else {
            this.isLoadSummary = true;
        }
        // let fbParams: InitParams = {
        //   appId: '231890343895713',
        //   xfbml: false,
        //   version: 'v3.1'
        // };
        // FB.init(fbParams);
