    toDashboard() {
        if (this.survey && this.survey.length) {
            this.router.navigate(["/dashboard"]);
            // this.router.navigate(['/survey', this.packageId]);
        }
        else {
            this.router.navigate(["/survey", this.packageId]);
        }
    }
    navigateReport() {
        if (this.reportDetails.reportTitle == "Career Guidance")
            this.router.navigate(["career-report/" + this.packageId]);
        else
            this.router.navigate(["view-package-report/" + this.packageId]);
    }
