// CONCATENATED MODULE: ./src/app/modules/static-pages/landing-page/products/student-product/student-product.component.ts

class StudentProductComponent {
    constructor(commonService, apiRequest) {
        this.commonService = commonService;
        this.apiRequest = apiRequest;
        this.packages = [];
    }
    ngOnInit() {
        if (this.commonService._isBrowser()) {
            let x = document.getElementById("navbar");
            x.style.background = "#2678e8";
            this.getPackages();
        }
    }
    getPackages() {
        this.loading = true;
        this.apiRequest.getAll("packages", "").subscribe((response) => {
            response.data.forEach(el => {
                if (!el["isCorporateType"] && el.cost > 0) {
                    this.packages.push(el);
                }
            });
            this.loading = false;
        }, error => {
            this.loading = false;
        });
    }
    showReportModal(item) {
        // showing sample report popup
        this.selected = item;
        //console.log(this.selected);
        this.reportModal.show();
    }
    showProductDetail(selectedPkg, index) {
        this.i = index;
        this.selectedpackage = selectedPkg;
        if (this.commonService._isBrowser()) {
            const focus = document.getElementById("focus");
            if (focus)
                focus.scrollIntoView();
        }
    }
    closeProduct() {
        this.selectedpackage = null;
    }
}

