// CONCATENATED MODULE: ./src/app/modules/static-pages/landing-page/products/customised-product/customised-product.component.ts


class CustomisedProductComponent {
    constructor(commonService, apiRequest, apiRequestService, toastr, formBuilder) {
        this.commonService = commonService;
        this.apiRequest = apiRequest;
        this.apiRequestService = apiRequestService;
        this.toastr = toastr;
        this.formBuilder = formBuilder;
        this.packages = [];
        this.payload = {};
        this.i = 0;
        this.connectForm = formBuilder.group({
            name: [""],
            email: [""],
            phoneNo: [""],
            message: ""
        });
    }
    connect(connectForm) {
        this.apiRequestService
            .basePost("ConnectWithUs", this.payload)
            .subscribe((response) => {
            // console.log(response);
            this.toastr.success("Thank you for connecting with us. We will contact you very soon!");
            connectForm.reset();
        });
    }
    ngOnInit() {
        if (this.commonService._isBrowser()) {
            let x = document.getElementById("navbar");
            x.style.background = "#2678e8";
            this.getPackages();
        }
    }
    getPackages() {
        this.loading = true;
        this.apiRequest.getAll("packages", "").subscribe((response) => {
            response.data.forEach(el => {
                if (el.cost === 0) {
                    this.packages.push(el);
                }
            });
            this.loading = false;
        }, error => {
            this.loading = false;
        });
    }
    showReportModal(item) {
        // showing sample report popup
        this.selected = item;
        //console.log(this.selected);
        this.reportModal.show();
        if (this.commonService._isBrowser()) {
            const focus = document.getElementById("focus");
            if (focus)
                focus.scrollIntoView();
        }
    }
    showProductDetail(selectedPkg, index) {
        this.i = index;
        this.selectedpackage = selectedPkg;
    }
}

