class ProductsComponent {
    constructor(apiRequestService, router, commonService) {
        this.apiRequestService = apiRequestService;
        this.router = router;
        this.commonService = commonService;
        this.loading = false;
        this.packageList = [];
        this.selected = [];
    }
    ngOnInit() {
        if (this.commonService._isBrowser()) {
            let x = document.getElementById("navbar");
            x.style.background = "#2678e8";
            this.loadPackages();
        }
    }
    loadPackages() {
        this.loading = true;
        this.apiRequestService.getAll("packages", "").subscribe((response) => {
            this.packageList = response.data;
            this.loading = false;
        }, error => {
            //todo: error handling
        });
    }
    showReportModal(item) {
        this.selected = item;
        //console.log(this.selected);
        this.reportModal.show();
    }
}

