// CONCATENATED MODULE: ./src/app/modules/dashboard/dashboard-categorisation/articles/articles.component.ts


class ArticlesComponent {
    constructor(apiRequestService, commonService, toastr) {
        this.apiRequestService = apiRequestService;
        this.commonService = commonService;
        this.toastr = toastr;
        this.packages = [];
        this.tempFeed = [];
        this.isPinned = false;
    }
    ngOnInit() {
        if (this.commonService._isBrowser()) {
            this.localUser = localStorage.getItem("currentUser");
            if (this.localUser) {
                this.userId = JSON.parse(localStorage.getItem("currentUser"));
                this.getLastTest();
            }
            // if(!this.userId.userData.firstTimeLogin){
            const screenWidth = window.outerWidth;
            if (screenWidth < 560) {
                this.commonService.closeNav();
            }
            else
                this.commonService.openNav();
            this.loadPackages();
        }
    }
    // loadArticles(event: number) {
    //   this.loading = true;
    //   this.busy = this.apiRequestService
    //     .getAll("feed", "")
    //     .subscribe(async response => {
    //       this.localUser = localStorage.getItem("currentUser");
    //       if (this.localUser) {
    //         this.userId = JSON.parse(localStorage.getItem("currentUser"));
    //         await this.getLastTest();
    //       }
    //       this.loading = false;
    //       this.feeds = response.data;
    //     });
    // }
    loadPackages() {
        this.apiRequestService.get("packages").subscribe((res) => {
            // this.packages = res.data;
            res.data.forEach(pkg => {
                if ((!pkg.isPaymentCompleted || !pkg.sessionId) &&
                    pkg.packageState != "FINISHED") {
                    this.packages.push(pkg);
                }
            });
        }, error => {
            //todo:handle error
        });
    }
    getLastTest() {
        var x = this.apiRequestService
            .getById("packageSessions/userId", this.userId.userData._id, {})
            .toPromise();
        x.then((res) => {
            if (res.data === "There is no package")
                this.lastTest = null;
            else
                this.lastTest = res.data;
        }, error => {
            //todo:handle error
        });
    }
    onScroll() {
        console.log("called");
    }
}

