// CONCATENATED MODULE: ./src/app/modules/dashboard/dashboard-categorisation/counsellors/counsellors.component.ts


class counsellors_component_CounsellorsComponent {
    constructor(apiRequestService, router, toastrService, apiRequest, commonService) {
        this.apiRequestService = apiRequestService;
        this.router = router;
        this.toastrService = toastrService;
        this.apiRequest = apiRequest;
        this.commonService = commonService;
        this.baseUrl = environment["a" /* environment */].apiUrl;
        this.chatUrl = environment["a" /* environment */].chatUrl;
        this.counsellorList = [];
        this.tempCounsellorsList = [];
        this.payload = {};
        this.counsellors = [];
        this.cptCounsellors = [];
        this.dateObj = [];
        this.isSlotSelected = false;
        this.isCounsellorRoute = false;
        this.cpt = [
            { title: "Education" },
            { title: "Career" },
            { title: "Employability" },
            { title: "Motivation" },
            { title: "package title" }
        ];
    }
    ngOnInit() {
        this.getCounsellors();
        if (this.router.url === "/counselling-experts") {
            this.isCounsellorRoute = true;
            this.getCPT();
        }
    }
    //getCounsellorByCPT
    getCounsellorByCPT(index, cptId) {
        this.selectedCol = index;
        this.cptCounsellors = [];
        this.tempCounsellorsList.forEach(el => {
            var x = el.packages.indexOf(cptId);
            if (x >= 0) {
                this.cptCounsellors.push(el);
            }
        });
        if (this.cptCounsellors.length > 0) {
            this.counsellorList = [];
            this.counsellorList = this.cptCounsellors;
        }
        else {
            this.counsellorList = [];
            this.counsellorList = this.tempCounsellorsList;
            this.toastrService.info("Currently No Counsellor are Available for this Package Title. See Other counsellor.");
        }
    }
    // setting selected slot background color
    changeColor(i) {
        this.selectedIndex = i;
    }
    //getting all counsellors
    getCounsellors() {
        this.busy = this.apiRequestService.getAll("counsellors", "").subscribe((response) => {
            if (this.limit) {
                this.counsellorList = response
                    .sort(function (a, b) {
                    return (a.sessionId || "zzz").localeCompare(b.sessionId || "zzz");
                    //return (a.aboutText.length - b.aboutText.length)
                })
                    .splice(0, this.limit);
            }
            else {
                this.counsellorList = response;
                this.tempCounsellorsList = this.counsellorList;
            }
            this.commonService.openNav();
        }, error => {
            //todo: Handle error
        });
    }
    showModal(counsellor) {
        this.selected = counsellor;
        let id = this.selected._id;
        this.bookingModal.show();
        // this.apiRequest.getById('counsellors', id + '/timeslots', {
        //     timezoneOffset: Number
        // }).subscribe((res:any) => {
        //   this.schedule = res;
        //   this.dateObj = {};
        //   this.schedule.forEach((element, index) => {
        //     this.dateObj[element.date] = index;
        //     // this.slots = res[this.dateObj.index].slots;
        //     // console.log(this.slots);
        //     // console.log(this.dateObj);
        //   });
        //   console.log(this.dateObj);
        // });
        this.apiRequest
            .getByQueryParams("counsellors/" + id + "/timeslots", {
            timezoneOffset: new Date().getTimezoneOffset(),
            from: new Date().getTime() - new Date().getTimezoneOffset() * 60000
        })
            .subscribe((res) => {
            this.schedule = JSON.parse(res._body);
            //sorting schedule time wise
            this.schedule.forEach((date, index) => {
                this.schedule[index].slots = date.slots.sort(function (a, b) {
                    const p = new Date(a.startTime);
                    const q = new Date(b.startTime);
                    return p - q;
                });
            });
            this.dateObj = {};
            //todo: dayname should display with date
            // var days = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
            // this.schedule.forEach((day, index) => {
            //   var date = day.date;
            //   var datearray = date.split("/");
            //   var newdate = datearray[1] + '/' + datearray[0] + '/' + datearray[2];
            //   let d = new Date(newdate);
            //   let dayName = days[d.getDay()];
            //   this.schedule[index].date += ' ' + dayName;
            // });
            this.schedule.forEach((element, index) => {
                this.dateObj[element.date] = index;
                // this.slots = res[this.dateObj.index].slots;
                // console.log(this.slots);
                // console.log(this.dateObj);
            });
        });
    }
    //setting slot details for booking
    setSlot(slot) {
        this.slots = slot;
        this.isSlotSelected = true;
    }
    // booking counsellor
    booking() {
        var d = new Date(this.slots.startTime);
        var x = new Date(d.valueOf() + d.getTimezoneOffset() * 60000);
        this.payload = {
            counsellorId: this.selected._id,
            // time: new Date(this.payload.time.getTime() + (Number(this.payload.duration))*60*60*1000).toUTCString(),
            // time: x.toISOString(),
            time: this.slots.startTime,
            // time: new Date((this.payload.time.getFullYear().toString()) + ((this.payload.time.getMonth()+1).toString()) + (this.payload.time.getDate().toString())  + (Number(this.payload.duration)*60*60*1000).toString()).toUTCString(),
            // Set duration here
            duration: 45,
            timezoneOffset: new Date().getTimezoneOffset()
        };
        console.log(this.payload);
        this.apiRequest
            .post(this.baseUrl + "counsellorBookings", this.payload)
            .subscribe((res) => {
            this.toastrService.success("Booking Successfull!");
            // console.log('success');
            this.isSlotSelected = false;
            this.payload = {};
            this.schedule = [];
            this.selected = [];
            this.bookingModal.hide();
        }, error => {
            //todo: Handle error
        });
    }
    getCPT() {
        this.apiRequest.get("counsellorPackageTitle").subscribe((res) => {
            this.cpt = res;
        }, error => {
            //todo: Handle error
        });
    }
    //trim username
    trimUsername(name) {
        return name.substring(0, 1);
    }
    //todo: random bckground color for default profile
    //random background color for user image
    // getRandomColor() {
    //   var letters = '0123456789ABCDEF';
    //   var color = '#';
    //   for (var i = 0; i < 6; i++) {
    //     color += letters[Math.floor(Math.random() * 16)];
    //   }
    //   return color;
    // }
    connectNow(id) {
        this.apiRequest.create("chats", { counsellorId: id }).subscribe((response) => {
            if (response.success) {
                this.router.navigateByUrl("/chat?counsellorId=" + id);
            }
        }, error => {
            //todo: Handle error
        });
    }
}

