class SignedinBrowsePackageComponent {
    // isProcessing: boolean = false;
    constructor(route, apiRequestService, packageService, authService, toastrService, commonService) {
        this.route = route;
        this.apiRequestService = apiRequestService;
        this.packageService = packageService;
        this.authService = authService;
        this.toastrService = toastrService;
        this.commonService = commonService;
        this.loading = false;
        this.packageList = [];
        this.package = {};
        this.isLoggedIn = false;
    }
    ngOnInit() {
        this.route.params.subscribe(params => {
            this.packageId = params["packageId"];
            this.getPackageDetails(this.packageId);
        });
        this.isLoggedIn = this.authService.isAuthenticated();
    }
    getPackageDetails(packageId) {
        // this.isProcessing = true;
        this.loading = true;
        this.busy = this.apiRequestService
            .getById("packages", packageId, {})
            .subscribe((response) => {
            this.commonService.closeNav();
            this.commonService.revokeMain();
            if (this.commonService._isBrowser()) {
                let x = document.getElementById("navbar");
                x.style.background = "#2678e8";
            }
            this.package = response.data[0];
            console.log(response);
            // this.isProcessing = false;
            this.loading = false;
        }, error => {
            this.loading = false;
        });
    }
    showReportModal() {
        this.reportModal.show();
    }
    subscribePackage(item) {
        this.packageService.subscribePackage(item._id).subscribe((response) => {
            this.toastrService.success(response.message);
            item.sessionId = response.data._id;
        }, error => [
            console.log('error')
        ]);
    }
    ngOnDestroy() {
        //Called once, before the instance is destroyed.
        //Add 'implements OnDestroy' to the class.
        this.commonService.initialMain();
    }
}

