class counsellor_details_component_CounsellorDetailsComponent {
    constructor(apiRequest, auth, route, toastrService) {
        this.apiRequest = apiRequest;
        this.auth = auth;
        this.route = route;
        this.toastrService = toastrService;
        this.counsellor = {};
        this.baseUrl = environment["a" /* environment */].apiUrl;
        this.chatUrl = environment["a" /* environment */].chatUrl;
        this.counsellorList = [];
        this.tempCounsellorsList = [];
        this.payload = {};
        this.counsellors = [];
        this.cptCounsellors = [];
        this.isSlotSelected = false;
        this.isCounsellorRoute = false;
    }
    ngOnInit() {
        this.route.params.subscribe(params => {
            this.counsellorId = params["counsellorId"];
            // console.log(this.counsellorId);
        });
        this.getCounsellorDetails(this.counsellorId);
        // To get the id from event emitter
        // this.apiRequest.seeCD.subscribe(data => {
        //   this.counsellorId = data._id;
        //   console.log("Emiter", this.counsellorId);
        // });
    }
    getCounsellorDetails(id) {
        this.busy = this.apiRequest
            .getById("users/counsellorDetail", id, {})
            .subscribe((res) => {
            this.counsellor = res;
            console.log(this.counsellor);
        });
    }
    showModal(counsellor) {
        this.selected = counsellor;
        let id = this.selected._id;
        this.bookingModal.show();
        // this.apiRequest.getById('counsellors', id + '/timeslots', {
        //     timezoneOffset: Number
        // }).subscribe((res:any) => {
        //   this.schedule = res;
        //   this.dateObj = {};
        //   this.schedule.forEach((element, index) => {
        //     this.dateObj[element.date] = index;
        //     // this.slots = res[this.dateObj.index].slots;
        //     // console.log(this.slots);
        //     // console.log(this.dateObj);
        //   });
        //   console.log(this.dateObj);
        // });
        this.apiRequest
            .getByQueryParams("counsellors/" + id + "/timeslots", {
            timezoneOffset: new Date().getTimezoneOffset(),
            from: new Date().getTime() - new Date().getTimezoneOffset() * 60000
        })
            .subscribe((res) => {
            this.schedule = JSON.parse(res._body);
            console.log(this.schedule);
            this.dateObj = {};
            //todo: dayname should display with date
            // var days = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
            // this.schedule.forEach((day, index) => {
            //   var date = day.date;
            //   var datearray = date.split("/");
            //   var newdate = datearray[1] + '/' + datearray[0] + '/' + datearray[2];
            //   let d = new Date(newdate);
            //   let dayName = days[d.getDay()];
            //   this.schedule[index].date += ' ' + dayName;
            // });
            this.schedule.forEach((element, index) => {
                this.dateObj[element.date] = index;
                // this.slots = res[this.dateObj.index].slots;
                // console.log(this.slots);
                // console.log(this.dateObj);
            });
        });
    }
    changeColor(i) {
        this.selectedIndex = i;
    }
    //setting slot details for booking
    setSlot(slot) {
        this.slots = slot;
        this.isSlotSelected = true;
    }
    // booking counsellor
    booking() {
        var d = new Date(this.slots.startTime);
        var x = new Date(d.valueOf() + d.getTimezoneOffset() * 60000);
        this.payload = {
            counsellorId: this.selected._id,
            // time: new Date(this.payload.time.getTime() + (Number(this.payload.duration))*60*60*1000).toUTCString(),
            // time: x.toISOString(),
            time: this.slots.startTime,
            // time: new Date((this.payload.time.getFullYear().toString()) + ((this.payload.time.getMonth()+1).toString()) + (this.payload.time.getDate().toString())  + (Number(this.payload.duration)*60*60*1000).toString()).toUTCString(),
            // Set duration here
            duration: 45,
            timezoneOffset: new Date().getTimezoneOffset()
        };
        console.log(this.payload);
        this.apiRequest
            .post(this.baseUrl + "counsellorBookings", this.payload)
            .subscribe((res) => {
            this.toastrService.success("Booking Successfull!");
            // console.log('success');
            this.payload = {};
            this.schedule = [];
            this.selected = [];
            this.bookingModal.hide();
        });
    }
}

