// CONCATENATED MODULE: ./src/app/modules/static-pages/survey/survey.component.ts


class SurveyComponent {
    constructor(apiRequestService, route, router, toastrService, commonService) {
        this.apiRequestService = apiRequestService;
        this.route = route;
        this.router = router;
        this.toastrService = toastrService;
        this.commonService = commonService;
        this.payload = {
            "testDifficultyLevel": "",
            "reportReflection": "",
            "userXp": 0,
            "recommandedUserEmail": "",
            "feedback": "",
            "packageId": "",
            "rating": 0
        };
        this.selectedItem = null;
        this.friendRecommanded = 'No';
        this.showFeedBack = false;
        this.entry = {};
        this.difficulty = [
            'Easy', 'Moderate', 'Difficult'
        ];
        this.reports = [{
                id: 'Yes',
                value: 'Yes'
            }, {
                id: 'No',
                value: 'No'
            }, {
                id: 'Somewhat',
                value: 'Somewhat'
            }];
        this.ratingOne = [
            {
                id: 1,
                value: 1
            },
            {
                id: 2,
                value: 2
            },
            {
                id: 3,
                value: 3
            },
            {
                id: 4,
                value: 4
            },
            {
                id: 5,
                value: 5
            },
        ];
        this.recommendFriend = [{
                id: 'Yes',
                value: 'Yes'
            }, {
                id: 'No',
                value: 'No'
            }];
    }
    ngOnInit() {
        this.route.params
            .subscribe((params) => {
            this.payload.packageId = params['packageId'];
        }, error => {
            //todo: error handling
        });
        this.commonService.closeNav();
    }
    onDifficultyChange(entry) {
        // this.payload.difficulty = entry;
    }
    onSelectionChangeOne(entry) {
        //  this.payload.reports = entry.id;
    }
    onSelectionChangeTwo(entry) {
        //  this.payload.userXp = entry.id;
    }
    onSelectionChangeThree(entry) {
        this.friendRecommanded = entry.id;
        this.payload.recommendFriend = entry.id;
    }
    // listClick(event, newValue) {
    //   console.log(newValue);
    //   this.selectedItem = newValue; 
    //   this.payload.rating = newValue.id;
    //   this.showFeedBack = true;
    //   console.log(this.showFeedBack);
    //    // don't forget to update the model here
    //   // ... do other stuff here ...
    // }
    openFeedback() {
        this.payload.rating = this.selectedItem;
        // show feedbackBox only if rating >=3
        if (this.payload.rating <= 3) {
            this.showFeedBack = true;
        }
        else {
            this.showFeedBack = false;
        }
    }
    submitSurvey() {
        if (this.payload.rating === 0 || this.payload.rating === undefined) {
            this.toastrService.error('Please give rating!');
            return null;
        }
        else {
            this.apiRequestService.basePost('surveys', this.payload).subscribe((response) => {
                this.toastrService.success('Thanks for the feedback!!! ');
                this.router.navigate(['dashboard']);
            }, error => {
                //todo: error handling
            });
        }
    }
}

