// CONCATENATED MODULE: ./src/app/modules/core/header-signedin/header-signedin.component.ts

class HeaderSignedinComponent {
    constructor(authService, userService, toastrService, router, commonService) {
        this.authService = authService;
        this.userService = userService;
        this.toastrService = toastrService;
        this.router = router;
        this.commonService = commonService;
        this.brandImgUrl = "../../../assets/images/Logo (1).png";
        this.flowImage = "../../../../assets/images/package/flow-dashboard.png";
        this.isSideBarClosed = true;
        authService.loggedIn$.subscribe(data => {
            this.ngOnInit();
        });
        authService.currentUser$.subscribe(data => {
            this.getUserData();
        });
    }
    ngOnInit() {
        if (this.authService.isAuthenticated()) {
            this.getUserData();
        }
    }
    getUserData() {
        this.user = this.authService.getUserData();
        // console.log(this.user);
    }
    logout() {
        this.authService.logout().subscribe((data) => {
            if (data.success) {
                this.authService.removeCredentials();
                this.toastrService.success("You have successfully logged out.");
                if (this.commonService._isBrowser()) {
                    localStorage.removeItem("freeTestPackageId");
                    localStorage.removeItem("isFree");
                    localStorage.clear();
                    this.isLoggedIn = this.authService.isAuthenticated();
                    this.router.navigate(["/login"]);
                    document.getElementById("mySidenav").style.width = "0px";
                    document.getElementById("main").style.marginLeft = "0px";
                    document.getElementById("main").style.marginTop = "0px";
                }
            }
        }, error => {
            //todo: Handle error
        });
    }
}

