// CONCATENATED MODULE: ./src/app/modules/core/header-signedout/header-signedout.component.ts

class HeaderSignedoutComponent {
    constructor(router) {
        this.router = router;
        this.brandImgUrl = "../../../assets/images/LOGO WHITE.svg";
    }
    ngOnInit() { }
    navigateToRegister() {
        this.router.navigate(["./register"], { queryParams: { free: true } });
    }
    openNav() {
        let nav = document.getElementById("myNav"); //overlay navbar open for small screens
        if (nav)
            nav.style.width = "100%";
    }
    closeNav() {
        let nav = document.getElementById("myNav"); //overlay navbar close for small screen
        if (nav)
            nav.style.width = "0%";
    }
}

