class SidebarMenuComponent {
    constructor(authService, apiRequest, commonService) {
        this.authService = authService;
        this.apiRequest = apiRequest;
        this.commonService = commonService;
    }
    ngOnInit() {
        this.isLoggedIn = this.authService.isAuthenticated();
        if (this.isLoggedIn) {
            this.authService.isLoggedIn();
            this.getUserData();
            this.getChatHistory();
            // this.openNav();
        }
    }
    getUserData() {
        this.user = this.apiRequest.get('users/isAuthenticated').subscribe((res) => {
            this.user = res.data;
            if (this.commonService._isBrowser())
                localStorage.setItem('currentUser', JSON.stringify(res.data));
        }, error => {
            //todo: Handle error
        });
        // console.log(this.user);
    }
    //chat history
    getChatHistory() {
        this.apiRequest.get('chats').subscribe((res) => {
            this.chatHistory = res.data;
            if (this.chatHistory.length > 0) {
                this.commonService.isChatHistory = true;
            }
            else {
                this.commonService.isChatHistory = false;
            }
        }, error => {
            //todo: Handle error
        });
    }
}

